import React from "react";

const ShortCut = ({ link, name, img }) => {
  return (
    <a href={link} target="_blank" rel="noreferrer" className="shortcut_item">
      <img src={img} alt="" />
      <span>{name}</span>
    </a>
  );
};

export default ShortCut;
